import React, { useEffect } from "react"
import { Flex } from "rebass"
import Editor from "./components/editor"
import socket from "./socket/socket.js"


const App = () => {

  useEffect(() => {
    const server = socket()
    server.joinRoom("room")
  })

  return (
    <Flex>
      <Editor/>
    </Flex>
  )
}

export default App;
